import Title from "../Title/Title";
import Modal from "../Modal/Modal";
import Button from "../Button/Button";
import styles from "./SignInModal.module.css";

function SignInModal() {
  return (
    <Modal classModal={`${styles.modal} center--flex`}>
      <Title className={styles.title}>welcome</Title>
      <p className="capitalize">please use google account to sign in</p>
      <p className="capitalize">
        note that we'll only access to your email account and name
      </p>
      <Button className={`${styles.btn} transition--25`}>
        sign in with google
      </Button>
    </Modal>
  );
}

export default SignInModal;
